namespace AOC.Services
{
    public class AvailableDaysService : IAvailableDaysService
    {
        private List<AvailableYear> AvailableYears { get; set; }

        private string processedInput { get; set; }

        private List<string> processedInputs { get; set; }

        public AvailableDaysService()
        {
            this.processedInputs = new List<string>();

            var input = "";

            this.processedInput = this.ProcessInput(input);

            for (char c = 'A'; c <= 'Z'; c++)
            {
                var tempInput = input;
                tempInput = tempInput.Replace(c.ToString(), string.Empty);
                tempInput = tempInput.Replace(c.ToString().ToLower(), string.Empty);
                processedInputs.Add(this.ProcessInput(tempInput));
            }

            //var assembly = Assembly.GetExecutingAssembly();
            //Stream stream = assembly.GetManifestResourceStream("AvailableDays.json");

            //string text = string.Empty;
            //using (var reader = new System.IO.StreamReader(stream))
            //{
            //    text = reader.ReadToEnd();
            //}

            //this.AvailableYears = JsonConvert.DeserializeObject<AvailableYears>(text).Years;
        }

        public int GetAvailableYears()
        {
            return this.processedInputs.Min(x => x.Length);
        }

        private string ProcessInput (string input)
        {
            var finished = false;

            while (!finished)
            {
                var tempInput = input;

                for (int i = 0; i < input.Length - 1; i++)
                {
                    var charA = input[i];
                    var charB = input[i + 1];
                    if (charA != charB && ((char.IsUpper(charA) && char.IsLower(charB)) || (char.IsLower(charA) && char.IsUpper(charB))) && (char.ToLower(charA) == char.ToLower(charB)))
                    {
                        input = input.Remove(i, 2);
                        break;
                    }
                }

                finished = tempInput.Length == input.Length;

            }

            return input;
        }
    }
}
